	dataList = {
		{11,1,3,-1,"普通攻擊",1,4,"img/icon/skill/module33_jianghu_jineng_0109.png",1,0,0,"","Attack1","","","","",0,"武學介紹",43,0,"17:18","",""},
		{12,1,3,-1,"普通攻擊",1,4,"img/icon/skill/module33_jianghu_jineng_0109.png",1,0,0,"","Attack2","","","","",0,"武學介紹",43,0,"17:18","",""},
		{29,1,1,-1,"夜行刀法",1,3,"img/icon/skill/module33_jianghu_jineng_0101.png",1,0,0,"13=1;2=3","Attack1","30","","151","3",189,"因出招時用勁柔韌， 縱使劈砍如電，卻也聽不到一點風聲，夜戰中自是大佔便宜。",46,0,"1121:2121","",""},
		{30,1,2,0,"夜戰八方",1,3,"img/icon/skill/module33_jianghu_jineng_0101.png",1,0,0,"","Martial","","","7","",0,"",6,0,"10030:10051","",""},
		{31,1,1,-1,"金烏刀譜",1,3,"img/icon/skill/module33_jianghu_jineng_0102.png",1,0,0,"13=1;3=2","Attack2","32","","2","3",190,"有感金烏西墜而創的刀法，多有劈掛之類動作，招式意象深遠，頗有餘韻不絕之感。",43,0,"1122:2122","",""},
		{32,1,2,0,"金烏朝日",1,3,"img/icon/skill/module33_jianghu_jineng_0102.png",1,0,0,"","Attack1","","","102","",0,"",8,0,"10020:10001","",""},
		{33,1,1,-1,"雪山劍訣",1,2,"img/icon/skill/module33_jianghu_jineng_0103.png",1,0,0,"14=1","Attack3","34","","152","3",191,"前輩高人遁隱雪山之巔所創，輕忽如霰雪飛花，急驟如雪子墜地，意態萬千，頗類雪花紛繁之象。",64,0,"1123:2123","",""},
		{34,1,2,0,"飛鴻印雪",1,2,"img/icon/skill/module33_jianghu_jineng_0103.png",1,0,0,"","Attack1","","","10","",0,"",10,0,"10030:10051","",""},
		{35,1,1,-1,"飛花劍法",1,2,"img/icon/skill/module33_jianghu_jineng_0104.png",1,0,0,"14=1;7=2","Attack4","36","","100","3",192,"飛花劍法是恆山派武學，該劍法施展時，劍花有如繽紛花瓣，煞是好看，但是美麗之下也隱藏著致命的殺機。",64,0,"1124:2124","",""},
		{36,1,2,0,"鶯啼細柳",1,2,"img/icon/skill/module33_jianghu_jineng_0104.png",1,0,0,"","Attack1","","","115","",0,"",1,0,"10020:10001","",""},
		{37,1,1,-1,"中平棍法",1,7,"img/icon/skill/module33_jianghu_jineng_0105.png",1,0,0,"15=1;4=1","Attack1","38","","3","3",193,"棍法取中正平和之意，招式自然也是直來直往，一板一眼，但唯其中正，更難以抵禦。",80,0,"1125:2125","",""},
		{38,1,2,0,"覆水難收",1,7,"img/icon/skill/module33_jianghu_jineng_0105.png",1,0,0,"","Attack1","","","128","",0,"",2,0,"10030:10051","",""},
		{39,1,1,-1,"狼牙棍法",1,7,"img/icon/skill/module33_jianghu_jineng_0106.png",1,0,0,"15=1;2=3","Attack2","40","","7","3",194,"本是繁複精妙的棍陣，棍影交錯如餓狼撲食，後經高手加以刪減，一人使出仍然威力十足。",77,0,"1126:2126","",""},
		{40,1,2,0,"以牙還牙",1,7,"img/icon/skill/module33_jianghu_jineng_0205.png",1,0,0,"","Attack1","","","156","",0,"",4,0,"10020:10001","",""},
		{41,1,1,-1,"雁行刃法",1,5,"img/icon/skill/module33_jianghu_jineng_0108.png",1,0,0,"16=1;7=2","Attack3","42","","153","3",195,"模擬雁行之姿所創的一套奇門功法，舞動起來如同南雁高飛，進退有序。",130,0,"1127:2127","",""},
		{42,1,2,0,"北雁南迴",1,5,"img/icon/skill/module33_jianghu_jineng_0108.png",1,0,0,"","Attack1","","","150","",0,"",6,0,"10030:10051","",""},
		{43,1,1,-1,"鬆濤雙劍",1,5,"img/icon/skill/module33_jianghu_jineng_0108.png",1,0,0,"16=1;2=3","Attack4","44","","155","3",196,"雙手劍法入門技法，舞動之時猶如鬆濤竹浪，連綿不絕。兼又雙手迭發，如一招應對失策，則殊難易手。",130,0,"1128:2128","",""},
		{44,1,2,0,"攬海聽濤",1,5,"img/icon/skill/module33_jianghu_jineng_0208.png",1,0,0,"","Attack1","","","151","",0,"",8,0,"10020:10001","",""},
		{45,1,1,-1,"通臂拳法",1,4,"img/icon/skill/module33_jianghu_jineng_0109.png",1,0,0,"12=1;3=2","Finger","46","","154","3",197,"《內家拳法》中曰：通臂，長拳也，即是說使兩臂貫通可以使拳攻擊加長，這正是“通臂”的真義。",140,0,"1129:2129","",""},
		{46,1,2,0,"白猿攀枝",1,4,"img/icon/skill/module33_jianghu_jineng_0109.png",1,0,0,"","Attack1","","","3","",0,"",10,0,"10030:10051","",""},
		{47,1,1,-1,"青蓮掌法",1,4,"img/icon/skill/module33_jianghu_jineng_01010.png",1,0,0,"12=1","Finger","48","","11","3",198,"青蓮掌法由唐朝青蓮居士李太白所創，招式變幻莫測，往往令敵人防不勝防。",147,0,"1130:2130","",""},
		{48,1,2,0,"步步生蓮",1,4,"img/icon/skill/module33_jianghu_jineng_01010.png",1,0,0,"","Attack1","","","4","",0,"",1,0,"10020:10001","",""},
		{49,1,1,-1,"吐納功",1,1,"img/icon/skill/module33_jianghu_jineng_01011.png",0,0,0,"0=11;1=7","Martial","50","","26","3",199,"吐納屬最基礎的煉氣技法，而胎息是吐納練息的最高境界，《抱朴子》雲：得胎息者，能不以鼻口噓吸，如入在胞胎之中。",92,0,"1131:2131","88","25"},
		{50,1,2,0,"瞑目靜心",1,1,"img/icon/skill/module33_jianghu_jineng_01011.png",0,0,0,"","Martial","","","1","",0,"",2,0,"10030:10051","",""},
		{51,1,1,-1,"坐忘功",1,1,"img/icon/skill/module33_jianghu_jineng_01012.png",0,0,0,"0=11;1=7","Martial","52","","33","3",200,"坐忘收心，主靜去欲，靜則生慧，動則成昏，與道冥一，萬慮皆遺，離形去智，同於大通，是謂坐忘。 ",92,0,"1132:2132","89","25"},
		{52,1,2,0,"離形去智",1,1,"img/icon/skill/module33_jianghu_jineng_02011.png",0,0,0,"","Martial","","","5","",0,"",4,0,"10020:10001","",""},
		{53,1,1,-1,"慈悲刀法",1,3,"img/icon/skill/module33_jianghu_jineng_0201.png",1,0,0,"13=1","Attack3","54","","115","3",201,"深諳佛家「慈悲為懷」理念的刀法，招式全無殺氣，處處點到即止，只求制敵不求傷人，反而分外難練。",43,0,"1133:2133","",""},
		{54,1,2,0,"高山仰止",1,3,"img/icon/skill/module33_jianghu_jineng_0201.png",1,0,0,"","Attack1","","","109","",0,"",6,0,"10030:10051","",""},
		{55,1,1,-1,"無極刀譜",2,3,"img/icon/skill/module33_jianghu_jineng_0202.png",1,0,0,"13=1;7=2","Attack2","56","","9","3",203,"變化繁複的一門基礎刀法，蔚為浩大，無數高階刀法或是脫胎於此，或是專精於其中方向。",43,0,"1134:2134","",""},
		{56,1,2,0,"旭日東昇",2,3,"img/icon/skill/module33_jianghu_jineng_0202.png",1,0,0,"","Attack1","","","155","",0,"",8,0,"10020:10001","",""},
		{57,1,1,-1,"連城劍訣",2,2,"img/icon/skill/module33_jianghu_jineng_0203.png",1,0,0,"14=1;6=2","Attack3","58","","151","3",205,"繪於一卷古舊圖譜上的奇妙劍法，更有傳言與一座價值連城的寶藏有關，只是無人能解。",48,0,"1135:2135","",""},
		{58,1,2,0,"無冬無夏",2,2,"img/icon/skill/module33_jianghu_jineng_0203.png",1,0,0,"","Attack1","","","15","",0,"",10,0,"10030:10051","",""},
		{59,1,1,-1,"鬆風劍法",1,2,"img/icon/skill/module33_jianghu_jineng_0204.png",1,0,0,"14=1;2=3","Attack4","60","","109","3",207,"兼具內家拳術與劍法特色，整個套路簡練扼要，意劍合一，步法奔騰如流水，身法靈活若遊龍，劍法凌厲似蛇信。",48,0,"1136:2136","",""},
		{60,1,2,0,"投桃報李",1,2,"img/icon/skill/module33_jianghu_jineng_0204.png",1,0,0,"","Attack1","","","7","",0,"",1,0,"10020:10001","",""},
		{61,1,1,-1,"驅蛇棍法",2,7,"img/icon/skill/module33_jianghu_jineng_0205.png",1,0,0,"15=1","Attack1","62","","2","3",209,"相傳為丐幫前代長老創立，棒法敏捷精確，順勢而為，變化精微，凌厲無比。",77,0,"1137:2137","",""},
		{62,1,2,0,"他山之石",2,7,"img/icon/skill/module33_jianghu_jineng_0206.png",1,0,0,"","Attack1","","","4","",0,"",2,0,"10030:10051","",""},
